import { Paper } from '@mui/material';
import Box from '@mui/material/Box';

export const RegisterPage = () => {
    return (
        <>
            <Box
                sx={{

                    height: "100vh",
                    background: "blue",
                    display: "flex",
                    flexDirection:"column",
                    justifyContent: "center",
                    alignItems: "center",
                }}
            >
                <Paper elevation={3}
                sx={{
                    height: "400px",
                    background: "red",
                    minWidth: "500px",
                }}
                >    
                </Paper>
            </Box>
        </>
    )
};
